#include <bits/stdc++.h>
using namespace std;
#define faster() ios_base::sync_with_stdio(false);cin.tie();cout.tie();
#define matrix vector <vector<long long>>
#define MOD 1000000007
#define el "\n"
const long long big = 1e6;

vector <long long> b(1e6,0);

int main() {
	faster();
	int t;
	cin >> t;
	while ( t-- )
	{
		int n, check = 0, res = -1;
		cin >> n;
		vector <long long> a(n);
		b.assign(1e6,0);
		for (int i = 0 ; i < n ; i++)
		{
			cin >> a[i];
			b[a[i]]++;
			if ( check == 0 && b[a[i]] == 2 )
			{
				res = a[i];
				check = 1;
			}
		}
		cout << res;
		if ( t != 0 )
		{
			cout << endl;
		}
	}
}

